#!/usr/bin/env python

from numpy import angle
import rospy
from rovus_bras.msg import feedback
import PySimpleGUI as sg
import time
from std_srvs.srv import SetBool, SetBoolResponse


#------------------------------------------------
#Variables globale
update_rate = 10
mem_keybind = 0
mem_toggle_mode = 0

#Image data
keybind_image = b""

class display_fdbk:
    
    singular_matrix = False
    
    j1 = '0'
    j2 = '0'
    j3 = '0'
    j4 = '0'

    m1 = '0'
    m2 = '0'
    m3 = '0'
    m4 = '0'

    ctrl_mode = 0
    current_joint = 0
    speed_multiplier = '0'
    limiteur = 0


fdbk = display_fdbk()

#--------------------------------------------------
#ROS
def feedback_callback(feedback: feedback):
    fdbk.singular_matrix = feedback.singular_matrix
    fdbk.j1 = str(round(feedback.j1, 2))
    fdbk.j2 = str(round(feedback.j2, 2))
    fdbk.j3 = str(round(feedback.j3, 2))
    fdbk.j4 = str(round(feedback.j4, 2))

    fdbk.m1 = str(round(feedback.m1, 2))
    fdbk.m2 = str(round(feedback.m2, 2))
    fdbk.m3 = str(round(feedback.m3, 2))
    fdbk.m4 = str(round(feedback.m4, 2))
    fdbk.speed_multiplier = str(round(feedback.speed_multiplier, 1))

    fdbk.ctrl_mode = feedback.ctrl_mode
    fdbk.current_joint = feedback.current_joint
    fdbk.speed_multiplier = fdbk.speed_multiplier
    fdbk.limiteur = feedback.limiteur

# ----------------  Create window  ----------------
sg.ChangeLookAndFeel('DarkGrey')

# ----------------  main loop  ----------------

rospy.init_node('feedback_node')
sub_feedback = rospy.Subscriber('rovus_bras_feedback', feedback, callback=feedback_callback)
#rospy.spin()

#Principal window
def main():
    start_in_arm_mode = rospy.get_param("~start_in_arm_mode", False)
    global mem_toggle_mode
    mem_toggle_mode = int(not start_in_arm_mode)

    layout = [
            [sg.Text(size=(40, 1), font=('Helvetica', 16), justification='center', key='singular_matrix', text_color='Yellow')],
            [sg.Text(size=(40, 1), font=('Helvetica', 16), justification='center', key='ctrl_mode')],
            [sg.Text('Angles : ', size=(40,1), font=('Helvetica', 16), justification='left', key='angle_title')],
            [sg.Text(size=(40, 1), font=('Helvetica', 14), justification='left', key='j1')],
            [sg.Text(size=(40, 1), font=('Helvetica', 14), justification='left', key='j2')],
            [sg.Text(size=(40, 1), font=('Helvetica', 14), justification='left', key='j3')],
            [sg.Text(size=(40, 2), font=('Helvetica', 14), justification='left', key='j4')],
            [sg.Text('Vitesses moteurs :', size=(15,1), font=('Helvetica', 16), justification='left', key='moteur_title'),
                 sg.Text(size=(25, 1), font=('Helvetica', 16), justification='left', key='limiting', text_color='Yellow')],
            [sg.Text(size=(40, 1), font=('Helvetica', 14), justification='left', key='mult')],
            [sg.Text(size=(40, 1), font=('Helvetica', 14), justification='left', key='m1')],
            [sg.Text(size=(40, 1), font=('Helvetica', 14), justification='left', key='m2')],
            [sg.Text(size=(40, 1), font=('Helvetica', 14), justification='left', key='m3')],
            [sg.Text(size=(40, 3), font=('Helvetica', 14), justification='left', key='m4')],
            [sg.Button('Switch to Rover mode' if start_in_arm_mode else 'Switch to Arm mode', font=('Helvetica', 16), size=(40, 1), button_color='#212121', key='rover_toggle')],
            [sg.Button('Keybinding', font=('Helvetica', 16), size=(40, 1), button_color='#212121', key='Keybind')]

         ]

    window = sg.Window('Rovus Arm HMI', layout)
    
    
    while (True):

        # --------- Update window / timeout ---------
        event, values = window.read(timeout=update_rate)
        # --------- Display timer in window ---------
        
        global mem_keybind


        # --------- Keybind window(2) ------------------
        if event == 'Keybind' and mem_keybind == 0:
            mem_keybind = 1
            
            layout2 =   [[sg.Text(size=(40, 1), font=('Helvetica', 16), justification='center', key='empty_line')],
                         [sg.Image(data=keybind_image)]
                        ]



            window2 = sg.Window("Keybinding", layout2)
            event, values = window2.read(timeout=update_rate)            

        elif event == 'Keybind' and mem_keybind == 1:
            mem_keybind = 0
            window2.close()


        #--------- Rover Mode / Joy mode --------------
        if event == 'rover_toggle' and mem_toggle_mode == 0:
            #send bool no error
                try:
                    rospy.ServiceProxy("/set_arm_joy", SetBool).call(True)
                except rospy.ServiceException as e:
                    rospy.logerr("Failed to swith to Rover mode, service unavailable: %s" % e)
                else:
                    window['rover_toggle'].update('Switch to Arm mode')
                    mem_toggle_mode = 1
                # We are now in Rover mode

            #send bool error
                #erreur

        elif event == 'rover_toggle' and mem_toggle_mode == 1:
            #send bool no error
                try:
                    rospy.ServiceProxy("/set_arm_joy", SetBool).call(False)
                except rospy.ServiceException as e:
                    rospy.logerr("Failed to swith to Arm mode, service unavailable: %s" % e)
                else:
                    window['rover_toggle'].update('Switch to Rover mode')
                    mem_toggle_mode = 0
                # We are now in Arm mode

            #send bool error
                #erreur


        # -------- Principal window -------------------

        if fdbk.singular_matrix == True:
            window['singular_matrix'].update('Singular Matrix --> Jog in joint')
        else:
            window['singular_matrix'].update('')

        if fdbk.ctrl_mode:
            window['ctrl_mode'].update('Mode Joint | J{:d} selectionn'.format(fdbk.current_joint))
        elif not fdbk.ctrl_mode:
            window['ctrl_mode'].update('Mode Cartsien')
        else:
            window['ctrl_mode'].update('Impossible de faire la connection')

        if fdbk.limiteur:
            window['limiting'].update(' Limiting')
        else:
            window['limiting'].update('')

        window['j1'].update('\tJ1 :  {:s}'.format(fdbk.j1.zfill(6)))
        window['j2'].update('\tJ2 :  {:s}'.format(fdbk.j2.zfill(6)))    
        window['j3'].update('\tJ3 :  {:s}'.format(fdbk.j3.zfill(6)))    
        window['j4'].update('\tJ4 :  {:s}'.format(fdbk.j4.zfill(6))) 


        window['mult'].update('Multiplicateur : {:s}'.format(fdbk.speed_multiplier))
        window['m1'].update('\tm1 :  {:s}'.format(fdbk.m1.zfill(4)))
        window['m2'].update('\tm2 :  {:s}'.format(fdbk.m2.zfill(4)))    
        window['m3'].update('\tm3 :  {:s}'.format(fdbk.m3.zfill(4)))    
        window['m4'].update('\tm4 :  {:s}'.format(fdbk.m4.zfill(4))) 

        if event == sg.WIN_CLOSED:
            break

if __name__ == "__main__":
    main()
